script: |
  super -f text -I q256.spq | sort > q256.out

inputs:
  - name: q256.spq
    data: |
      SELECT DISTINCT - ( 84 ) FROM tab0 (FORMAT parquet), tab1 (FORMAT parquet) cor0, tab1 (FORMAT parquet) AS cor1, tab1 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1

outputs:
  - name: q256.out
    data: |
      -84
